        </div>
        <div className="applylinks" style={{ flexGrow: 1 }}>
          <a href="#">Why Alem: Delivery</a>
        </div>
        <div className="applylinks" style={{ flexGrow: 1 }}>
          <a href="#">Why Alem: Shopping</a>
        </div>
      </div>
    );
  }
}
